package com.louji.jsonbean;

public class CartoonJsonBean
{
	private int cartoon_id;
	private String cartoon_titile;
	private String cartoon_content;
	private String cartoon_url;
	private String cartoon_image;
	private int cartoon_remmand;
	public CartoonJsonBean()
	{
		super();
		// TODO Auto-generated constructor stub
	}
	public int getCartoon_id()
	{
		return cartoon_id;
	}
	public void setCartoon_id(int cartoon_id)
	{
		this.cartoon_id = cartoon_id;
	}
	public String getCartoon_titile()
	{
		return cartoon_titile;
	}
	public void setCartoon_titile(String cartoon_titile)
	{
		this.cartoon_titile = cartoon_titile;
	}
	public String getCartoon_content()
	{
		return cartoon_content;
	}
	public void setCartoon_content(String cartoon_content)
	{
		this.cartoon_content = cartoon_content;
	}
	public String getCartoon_url()
	{
		return cartoon_url;
	}
	public void setCartoon_url(String cartoon_url)
	{
		this.cartoon_url = cartoon_url;
	}
	public String getCartoon_image()
	{
		return cartoon_image;
	}
	public void setCartoon_image(String cartoon_image)
	{
		this.cartoon_image = cartoon_image;
	}
	public int getCartoon_remmand()
	{
		return cartoon_remmand;
	}
	public void setCartoon_remmand(int cartoon_remmand)
	{
		this.cartoon_remmand = cartoon_remmand;
	}

}
